  const [users, setUsers] = useState<any>();

  const getUsers = () => {
    fetch("https://jsonplaceholder.typicode.com/users/")
      .then((persons) => persons.json())
      .then((json) => setUsers(json));
  };

  return (
    <>
      <div>Get users names: </div>;
    </>
  );
};
